export default function Products(){



    return (
       <table border="1">
           {
               ALL_PRODUCTS && ALL_PRODUCTS?.map((product,index)=>(

                <tr key={index}>
                    <td>{product.title}</td>
                    <td>{product.description}</td>
                    <td>{product.price}</td>
                </tr>

               ))
           }
         <tr>

         </tr>
       </table>
    )

}
